import { StoryObj } from '@storybook/react';
import IconFavorite from './IconFavorite';

const options = [true, false]

export default {
  title: 'Atoms/Icon',
  component: IconFavorite,
  argTypes: { 
      isFilled: { control: 'boolean', options }}
};


//@ts-ignore
const Template: StoryObj<typeof LinkButton> = (args) => <IconFavorite {...args} />;

//@ts-ignore
export const EmptyHeart = Template.bind({});
EmptyHeart.args = {
  isFilled: options[1],
};

//@ts-ignore
export const FilledHeart = Template.bind({});
FilledHeart.args = {
  isFilled: options[0],
};
